import React from 'react'

function Footer() {
  return (
    <footer class="pb-5">
        <div class="container text-center">
          <p class="font-italic text-muted mb-0">&copy; Copyrights Pk Store .com All rights reserved.</p>
        </div>
      </footer>
  )
}

export default Footer
